import React from 'react';
import '../../App.css';
import styles from 'staff.module.css'

const Staff=()=> {
  return (
    <div>
        <section id={styles.sec1}>
            <div className="container">
                <section className={styles.sec1_content}>
                    <div className={styles.card}></div>


                </section>
            </div>
        </section>
    </div>
  );
}

export default Staff;
